import React, { useState } from 'react';
import { createStyles, makeStyles, Theme } from '@material-ui/core/styles';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import ImportContactsIcon from '@material-ui/icons/ImportContacts';
import IMainProps from './interfaces/imainprops';
import RemoveIcon from '@material-ui/icons/Remove';
import MoreHorizIcon from '@material-ui/icons/MoreHoriz';
import Modal from '@material-ui/core/Modal';
import Backdrop from '@material-ui/core/Backdrop';
import Fade from '@material-ui/core/Fade';
import Button from '@material-ui/core/Button';
import { useDrop, DropTarget } from 'react-dnd';

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    listSelected: {
      backgroundColor: 'rgb(64,64,64)',
      borderRadius: '3px',
      '&:hover': {
        backgroundColor: 'rgb(51,51,51)',
        borderRadius: '3px',
      },
    },
    list: {
      '&:hover': {
        backgroundColor: 'rgb(51,51,51)',
        borderRadius: '3px',
      },
    },
    icon: {
      minWidth: '36px',
      color: 'rgb(165,165,165)',
    },
    removeNotebookIcon: {
      color: 'red',
      marginLeft: '20px',
    },
    menuNotebookIcon: {
      color: 'rgb(51,51,51)',
      marginLeft: '20px',
    },
    modal: {
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
    },
    paper: {
      backgroundColor: 'rgb(222, 222, 222)',
      boxShadow: theme.shadows[5],
      padding: '20px',
      textAlign: 'center',
      width: '350px',
      borderRadius: '5px',
      fontSize: '12px',
      outline: 'none',
    },
    paragraph: {
      fontSize: '16px',
      color: 'rgb(66, 54, 48)',
      marginBottom: '10px',
      padding: '10px',
    },
    button: {
      height: '30px',
      margin: '10px 15px',
    },
  })
);

interface SidebarItemProps extends IMainProps {
  thisNotebook: string;
  open: boolean;
  handleNotebookClick: (notebook: string) => void;
  removeNotebook: (id: string) => void;
}

export default function SidebarItem(props: SidebarItemProps) {
  const classes = useStyles();
  const [removeNotebookButton, setRemoveNotebookButton] = useState<boolean>(
    false
  );
  const [openModal, setOpenModal] = React.useState(false);

  const handleModalClose = () => {
    setOpenModal(false);
  };

  const removeNewNotebook = () => {
    setOpenModal(true);
  };

  const handleDeleteClick = () => {
    props.removeNotebook(props.thisNotebook);
    handleModalClose();
  };

  const canMoveNote = () => {
    console.log('note can be here');
  };

  const moveNote = () => {
    console.log(props.thisNotebook);
    console.log('note got here');
  };

  const [{ isOver, canDrop }, drop] = useDrop({
    accept: 'note',
    drop: () => moveNote(),
    collect: (monitor) => ({
      isOver: monitor.isOver(),
      canDrop: monitor.canDrop(),
    }),
  });
  const isActive = isOver && canDrop;
  return (
    <>
      <ListItem
        button
        key={props.notebooks[props.thisNotebook].id}
        className={
          props.notebook === props.thisNotebook
            ? classes.listSelected
            : classes.list
        }
        onClick={() => {
          if (!removeNotebookButton)
            props.handleNotebookClick(props.thisNotebook);
        }}
        style={{
          padding: props.open ? '0px 0px 0px 30px' : '0px 15px',
          backgroundColor: isActive ? 'green' : '',
          borderRadius: isActive ? '5px' : '',
        }}
        ref={drop}
      >
        <ListItemIcon>
          <ImportContactsIcon className={classes.icon} />
        </ListItemIcon>
        <ListItemText primary={props.notebooks[props.thisNotebook].title} />
        <ListItemIcon
          onClick={() => {
            removeNewNotebook();
          }}
          onMouseOver={() => setRemoveNotebookButton(true)}
          onMouseLeave={() => setRemoveNotebookButton(false)}
        >
          {removeNotebookButton && open ? (
            <RemoveIcon className={classes.removeNotebookIcon} />
          ) : (
            <MoreHorizIcon className={classes.menuNotebookIcon} />
          )}
        </ListItemIcon>
      </ListItem>
      <Modal
        className={classes.modal}
        open={openModal}
        closeAfterTransition
        BackdropComponent={Backdrop}
        BackdropProps={{
          timeout: 500,
        }}
      >
        <Fade in={openModal}>
          <div className={classes.paper}>
            <div className={classes.paragraph}>
              This will delete the folder and move all notes in this folder to
              trash.
            </div>
            <Button
              className={classes.button}
              variant="outlined"
              color="secondary"
              onClick={handleDeleteClick}
            >
              Delete
            </Button>
            <Button
              className={classes.button}
              variant="outlined"
              color="default"
              onClick={handleModalClose}
            >
              Cancel
            </Button>
          </div>
        </Fade>
      </Modal>
    </>
  );
}
